import React from 'react';
import logo from './logo.svg';
import './App.css';
import {GoogleMap, withScriptjs, withGoogleMap} from "react-google-maps"

function Map() {
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{lat: 12, lng: 12}} />
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

function App() {
  return (
    <div>Hello world</div>
  );
}

export default App;
